import React from "react";

const SignIn3 = () => {
	return (
		<>
			<input
				onSubmit={onSubmit}
				id="name"
				type="text"
				onChange={(e) => setName(e.target.value)}
			/>
			<p>Last Name</p>
			<input
				onSubmit={onSubmit}
				id="name"
				type="text"
				onChange={(e) => setName(e.target.value)}
			/>
			<p>Booking Reference</p>
			<input
				onSubmit={onSubmit}
				id="bookingRef"
				type="text"
				placeholder="TBT-"
				onChange={(e) => setBookingRef(e.target.value)}
			/>
			<p>Email</p>
			<input
				onSubmit={onSubmit}
				id="email"
				type="text"
				onChange={(e) => setEmail(e.target.value)}
			/>
			<p>
				I agree to the{" "}
				<a href="https://www.timberbush-tours.co.uk/terms-conditions">Terms</a>{" "}
				<input type="checkbox" />
			</p>
			<button
				type="submit"
				onClick={() => {
					onSubmit();
					props.setPage(3);
				}}
			>
				View My Booking
			</button>
		</>
	);
};

export default SignIn3;
